import React from 'react';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

function Workspace() {
  return (
    <div>
      {/* Bootstrap Navbar */}
      <Navbar bg="light" expand="lg">
        <Container>
          <Navbar.Brand href="#">Your App Name</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="ms-auto">
              <Nav.Link href="#logout">Logout</Nav.Link>
              <Nav.Link href="#status" style={{ color: 'green' }}>Status: Logged In</Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>

      {/* Bootstrap Grid System for Image Slots */}
      <Container className="mt-4">
        <Row>
          <Col xs={6} md={3}>
            <img src="https://via.placeholder.com/150" alt="Slot 1" className="img-fluid" />
          </Col>
          <Col xs={6} md={3}>
            <img src="https://via.placeholder.com/150" alt="Slot 2" className="img-fluid" />
          </Col>
        </Row>
        <Row className="mt-4">
          <Col xs={6} md={3}>
            <img src="https://via.placeholder.com/150" alt="Slot 3" className="img-fluid" />
          </Col>
          <Col xs={6} md={3}>
            <img src="https://via.placeholder.com/150" alt="Slot 4" className="img-fluid" />
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default Workspace;
